import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { Link } from 'react-router-dom';
import './Home.css';

const Home = () => {
  const [restaurants, setRestaurants] = useState([]);
  const [foodItems, setFoodItems] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');

  useEffect(() => {
    const fetchData = async () => {
      try {
        console.log('Fetching data...');
        const [restaurantsRes, foodItemsRes] = await Promise.all([
          axios.get('http://localhost:5000/api/restaurants', {
            headers: { 'Content-Type': 'application/json' }
          }),
          axios.get('http://localhost:5000/api/menu/featured', {
            headers: { 'Content-Type': 'application/json' }
          })
        ]);
        
        console.log('Restaurants response:', restaurantsRes.data);
        console.log('Food items response:', foodItemsRes.data);
        
        setRestaurants(restaurantsRes.data);
        setFoodItems(foodItemsRes.data);
        setLoading(false);
      } catch (err) {
        console.error('Error fetching data:', err);
        setError(err.response?.data?.message || 'Failed to fetch data. Please try again later.');
        setLoading(false);
      }
    };

    fetchData();
  }, []);

  if (loading) return <div className="loading">Loading...</div>;
  if (error) return <div className="error">{error}</div>;

  return (
    <div className="home">
      {/* Featured Food Items Section */}
      <section className="featured-section">
        <h2 className="section-title">Featured Items</h2>
        <div className="food-items-grid">
          {foodItems.map(item => (
            <div key={item._id} className="food-item-card">
              <img 
                src={item.image || 'https://via.placeholder.com/300x200'} 
                alt={item.name}
                className="food-item-image"
              />
              <div className="food-item-info">
                <h3>{item.name}</h3>
                <p className="food-description">{item.description}</p>
                <div className="food-item-meta">
                  <span className="food-price">${item.price.toFixed(2)}</span>
                  <Link to={`/restaurants/${item.restaurant._id}`} className="restaurant-link">
                    {item.restaurant.name}
                  </Link>
                </div>
                <button className="add-to-cart-btn">Add to Cart</button>
              </div>
            </div>
          ))}
        </div>
      </section>

      {/* Restaurants Section */}
      <section className="restaurants-section">
        <h2 className="section-title">Popular Restaurants</h2>
        <div className="restaurants-grid">
          {restaurants.map(restaurant => (
            <Link to={`/restaurants/${restaurant._id}`} key={restaurant._id} className="restaurant-card">
              <img 
                src={restaurant.image || 'https://via.placeholder.com/300x200'} 
                alt={restaurant.name}
                className="restaurant-image"
              />
              <div className="restaurant-info">
                <h3>{restaurant.name}</h3>
                <p className="cuisine">{restaurant.cuisine}</p>
                <div className="restaurant-meta">
                  <span>⭐ {restaurant.rating || '4.5'}</span>
                  <span>⏱️ {restaurant.deliveryTime || '30-45 min'}</span>
                </div>
              </div>
            </Link>
          ))}
        </div>
      </section>
    </div>
  );
};

export default Home;
